DROP TRIGGER IF EXISTS `LngLatInsert`;
DELIMITER ;;
CREATE TRIGGER `LngLatInsert` AFTER INSERT ON `locate` FOR EACH ROW UPDATE ship_info SET ship_lastlat=new.lat,ship_lastlon=new.lon,ship_lasttime=new.datetime WHERE id = new.ship_id
;;
